INSERT INTO `tl_content` (`id`, `pid`, `sorting`, `tstamp`, `fullsize`, `headline`, `ptable`, `singleSRC`, `text`) VALUES ( 100, 21, 512, UNIX_TIMESTAMP(), '1', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:56:"Create responsive multi-column layouts with a few clicks";}', 'tl_article', 0xb37a53d47acb11e4893459743ac631a1, '<p>The simple and effective <a href="https://rocksolidthemes.com/contao/plugins/columns">RockSolid Columns Plugin</a> allows you to <strong>divide your articles and modules into columns</strong>. And the responsive behavior of the content can be directly defined for every single element for <strong>mobile, tablet and desktop devices</strong>.</p>\n<p>Similar to the Contao core accordion element you can either wrap single or multiple elements. And controlling the proportions of uneven columns is as simple as creating even groups.</p>' );
