INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `alias`, `addImage`, `author`, `date`, `headline`, `published`, `singleSRC`, `teaser`, `time`, `url`) VALUES ( 1, 2, UNIX_TIMESTAMP(), 'themes-extensions', '1', 1, UNIX_TIMESTAMP(), 'Premium Themes & Extenstions created to perfectly fit together', '1', 0x285bc67e73f111e4893459743ac631a1, '<p>RockSolid Themes and Extensions are made to work. We release fast, regular updates to ensure you can always rely on our foundation of lovingly designed themes and solid extensions.</p>', UNIX_TIMESTAMP(), '{{news_url::4}}' );
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `alias`, `addImage`, `author`, `date`, `headline`, `published`, `singleSRC`, `subheadline`, `teaser`, `time`) VALUES ( 2, 2, UNIX_TIMESTAMP(), 'hand-coded-quality', '1', 1, 1425384000, 'Lovingly hand-coded, fast, reliable and always up-to-date', '1', 0x1aca2d5874b811e4893459743ac631a1, 'Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo.', '<p>Get regular free updates and improvements for your theme. Since we use the Contao Extension Repository for all our plugins updating to the latest version is a matter of seconds.</p>', 1425384000 );
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `alias`, `addImage`, `author`, `date`, `headline`, `published`, `singleSRC`, `subheadline`, `teaser`, `time`) VALUES ( 3, 2, UNIX_TIMESTAMP(), 'theme-assistant', '1', 1, 1459771200, 'Use the Theme Assistant to create individual designs without coding', '1', 0x18c9066274b011e4893459743ac631a1, 'Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', '<p>Easily change the fonts, colors and backgrounds with the click of a button and without touching a single line of code. Make your theme your own unique website, for a fraction of the price.</p>', 1459771200 );
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `alias`, `addImage`, `author`, `date`, `headline`, `published`, `singleSRC`, `subheadline`, `teaser`, `time`) VALUES ( 4, 2, UNIX_TIMESTAMP(), 'fully-responsive-contao-theme', '1', 1, 1493985600, 'Fully Responsive, Retina Ready and made to fit your needs', '1', 0xcd59d714747911e4893459743ac631a1, 'Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco.', '<p>Discover how RockSolid Themes and Extensions can completely transform the way you work. Start your next project using one of our high quality Contao Themes and save time and money.</p>', 1493985600 );
